import { useEffect, useState } from "react";

function ToDoList({ tasks, deleteTask, completeTask }) {
  return (
    <div>
      <h2>Task List</h2>
      {tasks.length === 0 ? (
        <p>No tasks available</p>
      ) : (
        tasks.map((task, index) => (
          <div key={index}>
            <p>
              {task.completed ? "[✓]" : "[✗]"} {task.description} (Priority:{" "}
              {task.priority}) {task.deadline ? `Deadline: ${task.deadline}` : ""}
            </p>
            <button onClick={() => completeTask(index + 1)}>
              Mark Complete
            </button>
            <button onClick={() => deleteTask(index + 1)}>Delete</button>
          </div>
        ))
      )}
    </div>
  );
}

export default ToDoList;
